import { Injectable } from '@angular/core';
import { BehaviorSubject } from 'rxjs';
import { Usuario } from  '../models/usuario';

@Injectable({
  providedIn: 'root'
})
export class UsuarioDataServiceService {

  private usuarioSource = new BehaviorSubject<Usuario|null>(null);
  usuarioActual = this.usuarioSource.asObservable();

  constructor() { }

  cambiarUsuario(usuario: Usuario) {
    this.usuarioSource.next(usuario);
  }
}
